import React from 'react';
import Navigation from '../../components/Navigation/Navigation';

const Home = (props) => {
  return (
    <div>
      <div className="homepage" style={{ backgroundColor: 'black', height: '100rem', marginTop: '50rem' }}>
        <Navigation />
      </div>
    </div>
  );
};

export default Home;
